import ReactPlayer from "react-player"
import Stack from '@mui/material/Stack';

const Home = () => {


    return (

        <Stack>
            <h2>Mark Fullen</h2>

            <div className="container">
                <p>I'm a frontend developer from Hilliard, Ohio. I've got a passion for music, especially playing drums around Columbus with all of the incredible local bands, I love helping people and working in a team to achieve great things!</p>
            </div>

            <ReactPlayer 
                url="https://www.youtube.com/watch?v=w3DpxfOnD1c"
            />

        </Stack>

    )

}

export default Home
